import React from 'react';
import { connect } from 'react-redux';
import styled from 'styled-components';
import { getJournal } from '../../../actions';
import { GridDiv } from './styles';

class EntryShow extends React.Component {
	componentDidMount() {
		console.log(this.props.match.params);
		this.props.getJournal(this.props.match.params.id);
	}
	render() {
		if (!this.props.journal) {
			return null;
		}

		return (
			<GridDiv>
				<EntriesList
					onEntryClick={this.onEntryClick}
					journal={this.props.journal}
				/>
				{this.props.journal._id}
			</GridDiv>
		);
	}
}

const mapStateToProps = (state, ownProps) => {
	return { journal: state.journals[ownProps.match.params.id] };
};

export default connect(mapStateToProps, { getJournal })(EntryShow);
